import './App.css';
import NavbarComp from './components/Navbar.jsx';
import About from './components/About';
import Work from './components/Work';

function App() {
  var skillArray=["React","Angular","Vanilla Js","Node"]
  var projectData=["React","Angular","Vanilla Js","Node"]
  return (
    <div className="App">
      <header >
      <NavbarComp/>     
      </header>
      <About skills={skillArray}/>
      <Work project={projectData}/>
      <footer>   
        <p>
            Thank you for taking the time to check this out --Hope you Have a Good Day   
        </p>
      </footer>
    </div>
  );
}

export default App;
